!function(){var insights=angular.module("ngYTInsights",[]);insights.service("ngYTInsights",function($http,$q){function getYoutubeChannelStats(channel){var chan=channel,request=$http({method:"get",cache:!0,url:baseUrl+chan+apikey});return request.then(handleSuccess,handleError)}function handleError(response){return angular.isObject(response.data)&&response.data.message?$q.reject(response.data.message):$q.reject("An unknown error occurred.")}function handleSuccess(response){return response.data}var baseUrl="https://www.googleapis.com/youtube/v3/channels?part=snippet,statistics&forUsername=",apikey="&key=AIzaSyCYwYrQTfWWYknZTnwHNLF0IhyUz-grzUw";return{getYoutubeChannelStats:getYoutubeChannelStats}})}();